export default class extends React.Component{
    render(){
        return <div>
                <h1>hola</h1>
                <p>bienvenidos</p>
                <img src="/static/logo.png"></img>
                <img src="/logo.jpg"></img>
                
                <style jsx>{`
                h1 {color: red};
                p {color: blue};
                `}</style>

                <style jsx global>{`
                body {background: yellow};
                `}</style>
            </div>
    }
}
